        static void Main(string[] args)
        {
            var input = _input;

            var patterns = input.Split(Environment.NewLine + Environment.NewLine);

            var total = 0;

            foreach (var pattern in patterns ) 
            {
                var rows = pattern.Split(Environment.NewLine);
                for(var i = 1; i < rows.Length; i++)
                {
                    if (rows[i] == rows[i-1])
                    {
                        var check = 0;
                        var isMirror = true;
                        while (i - 1 - check >= 0 && i + check < rows.Length)
                        {
                            if (rows[i - 1 - check] != rows[i + check])
                            {
                                isMirror = false;
                                break;
                            }
                            check++;
                        }
                        if (isMirror)
                        {
                            total += (100 * i);
                            break;
                        }
                    }
                }

                for (var i = 1; i < rows[0].Length; i++)
                {
                    if (string.Concat(rows.Select(x => x[i - 1])) == string.Concat(rows.Select(x => x[i])))
                    {
                        var check = 0;
                        var isMirror = true;
                        while (i - 1 - check >= 0 && i + check < rows[0].Length)
                        {
                            if (string.Concat(rows.Select(x => x[i - 1 - check])) != string.Concat(rows.Select(x => x[i + check])))
                            {
                                isMirror = false;
                                break;
                            }
                            check++;
                        }
                        if (isMirror)
                        {
                            total += i;
                            break;
                        }
                    }

                }


            }

            Console.WriteLine(total);
        }

